import React, { Component } from 'react';
import {connect} from 'react-redux';
import {newUser, inviteCodeCheck} from './../../actions/user.actions';
import {getUser, getGood} from './../../reducers/user.reducer';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';

class CreateAccountPage extends Component {
  constructor(props){
    super(props)
    this.state={
      name:"",
      username:"",
      password:"",
      passconfirm:"",
      email:"",
      invitecode:"",
    }
    this.handleChange=this.handleChange.bind(this);
    this.handleSubmit=this.handleSubmit.bind(this);
    this.handleKeyPress=this.handleKeyPress.bind(this);
    this.handleInviteCheck=this.handleInviteCheck.bind(this);
  }
  handleChange(target, e){
    if (target==="username"){
      this.setState({username:e.target.value})
      this.setState({name:e.target.value})
    } else {
      let change ={}
      change[target] = e.target.value
      this.setState(change)
    }
  }
  handleSubmit(){
    if(this.state.password===this.state.passconfirm){
      this.props.dispatch(newUser(this.state))
    } else{
      alert("Passwords do not match")
    }
  }
  handleInviteCheck(){
    return this.props.dispatch(inviteCodeCheck({invite:this.state.invitecode}))
  };
  handleKeyPress(e){
    if(e.key === 'Enter'){
      this.handleSubmit();
    }
  }

  render() {
    if(this.props.user.username!==undefined && this.props.user.token!==false) {
      this.props.history.push(`/source/${this.state.username}`);
    }
    return (
      <div className="CreateAccountPage">
        <Typography variant="display3">Create Account</Typography>
        <div className="Form">
          <TextField
            id="username-input"
            label="Username"
            value={this.state.username}
            onChange={(e)=>{this.handleChange("username", e)}}
            onKeyPress={(e)=>{this.handleKeyPress(e)}}
            margin="normal"
          />
          <TextField
            id="email-input"
            label="Email"
            value={this.state.email}
            onChange={(e)=>{this.handleChange("email", e)}}
            onKeyPress={(e)=>{this.handleKeyPress(e)}}
            margin="normal"
          />
          <TextField
            id="password-input"
            label="Password"
            type="password"
            value={this.state.password}
            onChange={(e)=>{this.handleChange("password", e)}}
            onKeyPress={(e)=>{this.handleKeyPress(e)}}
            margin="normal"
          />
          <TextField
            id="passconfirm-input"
            label="Confirm Password"
            type="password"
            value={this.state.passconfirm}
            onChange={(e)=>{this.handleChange("passconfirm", e)}}
            onKeyPress={(e)=>{this.handleKeyPress(e)}}
            margin="normal"
          />
          <TextField
            id="invitecode-input"
            label="Invite Code"
            value={this.state.invitecode}
            onChange={(e)=>{this.handleChange("invitecode", e)}}
            onKeyPress={(e)=>{this.handleKeyPress(e)}}
            margin="normal"
          />
          {this.state.password!==this.state.passconfirm && (
            <Typography variant="caption" className="PasswordAlert">passwords do not match!</Typography>
          )}
          <Button variant="raised" color="primary" className="SubmitButton" onClick={this.handleSubmit}>Submit</Button>
        </div>
      </div>
    );
  }
}

const mapStateToProps=(state)=>{
  return{
    user: getUser(state),
    good: getGood(state)
  }
}
export default connect(mapStateToProps)(CreateAccountPage);
